import React from 'react'
import { Link, NavLink, Match, NoMatch } from 'react-router-dom'

const Header = () => {

    return(
        // <ul className='UL-List'>
        <div className='UL-List'>
            <NavLink to='/find' className="HeadItem" id="HeadItem-R">
            Find
            </NavLink>
            <NavLink to='/' activeClassName='activehead' className="HeadItem" id="HeadItem-L">
            Home
            </NavLink>
        </div>
        // </ul>
        
    )
}

export default Header;
